import './SanFrancisco.css';

function SanFrancisco() {
  return (
    <div className="SanFrancisco">
      <p>In the beginning there was the sea. And the sea was without form, and void; and darkness was upon the face of the deep. And a light moved upon the face of the waters.</p>
      <p></p>
    </div>
  );
}

export default SanFrancisco;
